const {useState,useRef,useEffect,useCallback} = React;

function App(){
  // Display mode
  const [layer,setLayer] = useState('overlay');
  // Sliders
  const [tempMin,setTempMin] = useState(95);
  const [tempMax,setTempMax] = useState(99);
  const [canMin,setCanMin] = useState(0);
  const [canMax,setCanMax] = useState(25);
  const [incMin,setIncMin] = useState(10000);
  const [incMax,setIncMax] = useState(50000);
  const [povMin,setPovMin] = useState(20);
  const [povMax,setPovMax] = useState(75);
  // Toggles
  const [useTemp,setUseTemp] = useState(true);
  const [useCan,setUseCan] = useState(true);
  const [useInc,setUseInc] = useState(true);
  const [usePov,setUsePov] = useState(false);
  const [showTracts,setShowTracts] = useState(true);
  const [hovered,setHovered] = useState(null);
  const canvasRef = useRef(null);

  const G = D.grid;
  const W = 960, PAD = 8;
  const SC = (W-PAD*2)/G.ncols;
  const H = Math.ceil(SC*G.nrows+PAD*2);
  const toX = c => PAD+(c-G.xmin)*SC;
  const toY = r => PAD+(G.nrows-1-(r-G.ymin))*SC;

  // Colors
  function lerp(a,b,t){
    const ah=parseInt(a.slice(1),16),bh=parseInt(b.slice(1),16);
    const ar=(ah>>16)&0xff,ag=(ah>>8)&0xff,ab=ah&0xff;
    const br=(bh>>16)&0xff,bg=(bh>>8)&0xff,bb=bh&0xff;
    return '#'+((1<<24)+(Math.round(ar+(br-ar)*t)<<16)+(Math.round(ag+(bg-ag)*t)<<8)+Math.round(ab+(bb-ab)*t)).toString(16).slice(1);
  }
  function scaleC(v,mn,mx,cols){
    if(v==null) return null;
    let t=Math.max(0,Math.min(1,(v-mn)/(mx-mn)));
    let i=t*(cols.length-1),lo=Math.floor(i),hi=Math.min(lo+1,cols.length-1);
    return lerp(cols[lo],cols[hi],i-lo);
  }
  const CL={
    temp:['#fef9c3','#fbbf24','#f97316','#dc2626'],
    cn:['#fef9c3','#86efac','#22c55e','#14532d'],
    inc:['#dbeafe','#60a5fa','#2563eb','#1e3a8a'],
    pov:['#fef3c7','#fcd34d','#f59e0b','#92400e']
  };

  // Match logic
  function cellMatch(c){
    let active=0, matched=0;
    if(useTemp && c.t!=null)  { active++; if(c.t>=tempMin && c.t<=tempMax) matched++; }
    if(useCan && c.cn!=null)  { active++; if(c.cn>=canMin && c.cn<=canMax) matched++; }
    if(useInc && c.inc!=null) { active++; if(c.inc>=incMin && c.inc<=incMax) matched++; }
    if(usePov && c.pov!=null) { active++; if(c.pov>=povMin && c.pov<=povMax) matched++; }
    return {active,matched};
  }

  function cellColor(c){
    if(layer==='temp')   return scaleC(c.t,93,99,CL.temp);
    if(layer==='canopy') return scaleC(c.cn,0,75,CL.cn);
    if(layer==='income') return scaleC(c.inc,12000,212000,CL.inc);

      ctx.fillStyle=col||'#f8fafc';
      ctx.fillRect(x,y,SC,SC);
    });

    if(m.active===0) return;
    if(m.matched===m.active) allMatch++;
    else if(m.matched>0) someMatch++;
    else noMatch++;
  });

  // Slider helper
  function sld(label,valMin,setMin,valMax,setMax,absMin,absMax,step,color,fmt){
    if(!fmt) fmt=v=>v;
    return e('div',null,
      e('div',{className:'sld'},
        e('label',null,'Min'),
        e('input',{type:'range',min:absMin,max:absMax,step:step,value:valMin,
          style:{accentColor:color},
          onChange:ev=>{setMin(Math.min(+ev.target.value,valMax));}}),
        e('span',{className:'vl',style:{color:color}},fmt(valMin))),
      e('div',{className:'sld'},
        e('label',null,'Max'),
        e('input',{type:'range',min:absMin,max:absMax,step:step,value:valMax,
          style:{accentColor:color},
          onChange:ev=>{setMax(Math.max(+ev.target.value,valMin));}}),
        e('span',{className:'vl',style:{color:color}},fmt(valMax))));
  }

  const LGD={
    temp:{g:'linear-gradient(90deg,#fef9c3,#fbbf24,#f97316,#dc2626)',lo:'93\u00b0F',hi:'99\u00b0F'},
    canopy:{g:'linear-gradient(90deg,#fef9c3,#86efac,#22c55e,#14532d)',lo:'0%',hi:'75%'},
    income:{g:'linear-gradient(90deg,#dbeafe,#60a5fa,#2563eb,#1e3a8a)',lo:'$12k',hi:'$212k'},
    poverty:{g:'linear-gradient(90deg,#fef3c7,#fcd34d,#f59e0b,#92400e)',lo:'0%',hi:'70%'}
  };

  const hovC = hovered ? hovered.cell : null;
  const hovM = hovC ? cellMatch(hovC) : null;

  return e('div',{className:'row'},
    e('div',{className:'side'},
      // Display mode
      e('div',{className:'cd'},
        e('div',{className:'cd-t'},'Display Mode'),
        ['overlay','temp','canopy','income','poverty'].map(id=>
          e('label',{key:id,className:'radio-row',onClick:()=>setLayer(id)},
            e('input',{type:'radio',name:'lyr',checked:layer===id,readOnly:true}),
            e('span',{className:'sw',style:{background:
              id==='overlay'?'linear-gradient(135deg,#fbbf24,#dc2626)':
              id==='temp'?'linear-gradient(135deg,#fef9c3,#dc2626)':
              id==='canopy'?'linear-gradient(135deg,#fef9c3,#14532d)':
              id==='income'?'linear-gradient(135deg,#dbeafe,#1e3a8a)':
              'linear-gradient(135deg,#fef3c7,#92400e)'}}),
            id==='overlay'?'Filter Overlay (match all)':
            id==='temp'?'Surface Temperature':
            id==='canopy'?'Tree Canopy Cover':
            id==='income'?'Median Income':'Poverty Rate'))),

      // Temperature
      e('div',{className:'cd'},
        e('div',{className:'cd-t'},
          e('label',{className:'chk'},
            e('input',{type:'checkbox',checked:useTemp,onChange:()=>setUseTemp(!useTemp)}),
            'Surface Temperature (\u00b0F)')),
        sld('Temp',tempMin,setTempMin,tempMax,setTempMax,93,99,0.5,'#dc2626',v=>v+'\u00b0F')),

      // Canopy
      e('div',{className:'cd'},
        e('div',{className:'cd-t'},
          e('label',{className:'chk'},
            e('input',{type:'checkbox',checked:useCan,onChange:()=>setUseCan(!useCan)}),
            'Tree Canopy Cover (%)')),
        sld('Can',canMin,setCanMin,canMax,setCanMax,0,75,1,'#16a34a',v=>v+'%')),

      // Income
      e('div',{className:'cd'},
        e('div',{className:'cd-t'},
          e('label',{className:'chk'},
            e('input',{type:'checkbox',checked:useInc,onChange:()=>setUseInc(!useInc)}),
            'Median Household Income')),
        sld('Inc',incMin,setIncMin,incMax,setIncMax,10000,220000,5000,'#2563eb',v=>'$'+(v/1000).toFixed(0)+'k')),

      // Poverty
      e('div',{className:'cd'},
        e('div',{className:'cd-t'},
          e('label',{className:'chk'},
            e('input',{type:'checkbox',checked:usePov,onChange:()=>setUsePov(!usePov)}),
            'Poverty Rate (%)')),
        sld('Pov',povMin,setPovMin,povMax,setPovMax,0,75,1,'#d97706',v=>v+'%')),

      // Overlay
      e('label',{className:'chk',style:{marginTop:'0.15rem'}},
        e('input',{type:'checkbox',checked:showTracts,onChange:()=>setShowTracts(!showTracts)}),
        'Show census tract boundaries'),

      // Stats
      layer==='overlay' && e('div',{className:'stat-cd'},
        e('div',{className:'cd-t'},'Matching Cells'),
        e('div',{className:'stat-g'},
          e('div',{className:'stat-b',style:{background:'#fef2f2'}},
            e('div',{className:'stat-n',style:{color:'#dc2626'}},allMatch),
            e('div',{className:'stat-l'},'All match')),
          e('div',{className:'stat-b',style:{background:'#fff7ed'}},
            e('div',{className:'stat-n',style:{color:'#f97316'}},someMatch),
            e('div',{className:'stat-l'},'Partial')),
          e('div',{className:'stat-b',style:{background:'#f8fafc'}},
            e('div',{className:'stat-n',style:{color:'#94a3b8'}},noMatch),
            e('div',{className:'stat-l'},'No match')))),

      e('div',{className:'note'},'235 census tracts. Social variables (income, poverty) are mapped from tract-level ACS data to the 1 km\u00b2 grid cells within each tract.')),

    // Map
    e('div',null,
      e('div',{className:'map-cd'},
        e('div',{className:'map-t'},
          layer==='overlay'?'Filter Overlay \u2014 cells matching all active criteria':
          layer==='temp'?'Surface Temperature (\u00b0F)':
          layer==='canopy'?'Tree Canopy Cover (%)':
          layer==='income'?'Median Household Income ($)':
          'Poverty Rate (%)'),
        e('div',{className:'cw'},
          e('canvas',{ref:canvasRef,onMouseMove:onMove,onMouseLeave:()=>setHovered(null)}),
          hovered && e('div',{className:'tip',style:{left:Math.min(hovered.x+12,W-210),top:hovered.y+12}},
            e('div',null,e('b',null,'Grid: '),'Row '+hovC.r+', Col '+hovC.c),
            hovC.tn && e('div',null,e('b',null,'Tract: '),hovC.tn),
            e('div',{className:'sep'}),
            e('div',null,e('b',null,'Temp: '),hovC.t!=null?e('span',{style:{color:'#dc2626'}},hovC.t.toFixed(1)+' \u00b0F'):'N/A'),
            e('div',null,e('b',null,'Canopy: '),hovC.cn!=null?e('span',{style:{color:'#16a34a'}},hovC.cn.toFixed(1)+'%'):'N/A'),
            e('div',null,e('b',null,'Impervious: '),hovC.im!=null?hovC.im.toFixed(1)+'%':'N/A'),
            e('div',{className:'sep'}),
            e('div',null,e('b',null,'Income: '),hovC.inc!=null?e('span',{style:{color:'#2563eb'}},'$'+hovC.inc.toLocaleString()):'N/A'),
            e('div',null,e('b',null,'Poverty: '),hovC.pov!=null?e('span',{style:{color:'#d97706'}},hovC.pov+'%'):'N/A'),
            layer==='overlay' && hovM && e('div',null,e('div',{className:'sep'}),
              e('b',null,'Match: '),hovM.matched+' / '+hovM.active+' filters'))),
        e('div',{className:'lgd'},
          layer==='overlay' ? [
            e('div',{key:'a',className:'lgd-item'},e('span',{className:'lgd-sq',style:{background:'#dc2626'}}),'All match'),
            e('div',{key:'b',className:'lgd-item'},e('span',{className:'lgd-sq',style:{background:'#f97316'}}),'Partial'),
            e('div',{key:'c',className:'lgd-item'},e('span',{className:'lgd-sq',style:{background:'#fbbf24'}}),'1 match'),
            e('div',{key:'d',className:'lgd-item'},e('span',{className:'lgd-sq',style:{background:'#e2e8f0'}}),'No match')
          ] : [
            e('div',{key:'bar'},
              e('div',{className:'lgd-bar',style:{background:LGD[layer].g}}),
              e('div',{className:'lgd-lbl'},e('span',null,LGD[layer].lo),e('span',null,LGD[layer].hi))),
            e('div',{key:'nd',className:'lgd-item'},e('span',{className:'lgd-sq',style:{background:'#f8fafc',border:'1px solid #d1d5db'}}),'No data')
          ],
          showTracts && e('div',{className:'lgd-item'},
            e('span',{style:{display:'inline-block',width:14,height:0,borderTop:'1.5px solid rgba(100,116,139,0.5)',marginRight:3,verticalAlign:'middle'}}),'Tract boundary')))));
}
ReactDOM.render(e(App),document.getElementById('root'));
</script>
</body>
</html>
